    data: |
      SELECT DISTINCT - col1 FROM tab2 (FORMAT parquet) WHERE NOT - ( + - col1 ) BETWEEN + col1 / CAST ( NULL AS INTEGER ) AND + col1 + - col2;
  - name: tab2

outputs:
  - name: q4620.out
    data: |
      -51
      -67
      -77
